const factions = {
  terran: {
    icon: "/marine.png",
    production: {
      factory: "/factory.png",
      barracks: "/barracks.png",
    }
  },
  zerg: {
    icon: "/zergling.png",
  },
  protoss: {
    icon: "/zealot.png"
  }
}

export const UnitSelector = () => {


  return Object.values(factions).map((item, index) => {
    return (
      <div key={index}>
        <img src={item.icon}></img>
        {item.production ? 
        Object.values(item.production).map((structure,idx) => {
          return (
            <img src={structure}></img>
          );
        }):
        ""

      }
        </div>

    );
  })


}
